import React from 'react';

const Dashboard = () => {
  // Styles
  const container = {
    backgroundColor: '#121212',
    color: '#fff',
    minHeight: '100vh',
    padding: '20px',
    fontFamily: 'Arial, sans-serif'
  };

  const navbar = {
    display: 'flex',
    justifyContent: 'space-around',
    backgroundColor: '#1f1f1f',
    padding: '10px 0',
    marginBottom: '20px'
  };

  const navItem = {
    color: '#fff',
    textDecoration: 'none',
    fontSize: '18px'
  };

  const card = {
    backgroundColor: '#1f1f1f',
    padding: '20px',
    borderRadius: '8px',
    marginBottom: '20px',
    boxShadow: '0 2px 5px rgba(0,0,0,0.5)'
  };

  const statusGreen = {
    color: 'lime',
    fontWeight: 'bold'
  };

  const searchInput = {
    width: '100%',
    padding: '10px',
    borderRadius: '5px',
    border: '1px solid #444',
    backgroundColor: '#1a1a1a',
    color: '#fff',
    marginBottom: '10px'
  };

  const tableContainer = {
    overflowX: 'auto',
    marginTop: 20
  };

  const tableStyle = {
    width: '100%',
    borderCollapse: 'collapse',
    backgroundColor: '#1a1a1a',
    color: '#fff',
    minWidth: '600px'
  };

  const thStyle = {
    padding: '12px 15px',
    textAlign: 'left',
    borderBottom: '2px solid #444',
    fontWeight: 'bold'
  };

  const tdStyle = {
    padding: '12px 15px',
    borderBottom: '1px solid #333'
  };

  return (
    <div style={container}>
      {/* Navbar */}
      <nav style={navbar}>
        <a style={navItem} href="#">Dashboard</a>
        <a style={navItem} href="#">Policies</a>
        <a style={navItem} href="#">Settings</a>
        <a style={navItem} href="#">Logout</a>
      </nav>

      {/* Dashboard Title */}
      <h2>Dashboard - DoS Monitoring</h2>

      {/* DoS Attacks Card */}
      <div style={card}>
        <h3>Detected DoS Attacks: 5</h3>
        <p>Last Attack: 2 mins ago</p>
      </div>

      {/* System Status Card */}
      <div style={card}>
        <h3>Current System Status: <span style={statusGreen}>Operational</span></h3>
      </div>

      {/* Search Input */}
      <input style={searchInput} type="text" placeholder="Search..." />

      {/* Table */}
      <div style={tableContainer}>
        <table style={tableStyle}>
          <thead>
            <tr>
              <th style={thStyle}>#</th>
              <th style={thStyle}>Column 1</th>
              <th style={thStyle}>Column 2</th>
              <th style={thStyle}>Column 3</th>
              <th style={thStyle}>Column 4</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td style={tdStyle}>1</td>
              <td style={tdStyle}>Example</td>
              <td style={tdStyle}>Data</td>
              <td style={tdStyle}>Here</td>
              <td style={tdStyle}>Now</td>
            </tr>
            {/* Add more rows as needed */}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Dashboard;
